import "./Rightbar.css"

export default function Rightbar() {
  return (
    <div className="rightbar">
       <div className="rightbarWrapper">
          <div className="birdthdayContainer">
            <img src="assets/post/gift.png" className="birthdayImg" alt="" />
          </div>
       </div>
    </div>
  )
}
